import React, { useState, useEffect } from 'react';

const WeeklyAppointments = ({ citas, pacientes }) => {
  const [citasSemana, setCitasSemana] = useState([]);
  const [hoy] = useState(new Date());

  useEffect(() => {
    const actualizarCitasSemana = () => {
      const inicioSemana = new Date(hoy);
      inicioSemana.setHours(0, 0, 0, 0);

      const finSemana = new Date(hoy);
      finSemana.setDate(finSemana.getDate() + 7);
      finSemana.setHours(23, 59, 59, 999);

      const citasFiltradas = citas
        .filter(cita => {
          const fechaCita = new Date(cita.fecha);
          return (
            cita.estado === 'pendiente' &&
            fechaCita >= inicioSemana &&
            fechaCita <= finSemana
          );
        })
        .sort((a, b) => new Date(a.fecha) - new Date(b.fecha));

      setCitasSemana(citasFiltradas);
    };

    actualizarCitasSemana();
  }, [citas, hoy]);

  const getPacienteNombre = (id) => {
    const paciente = pacientes.find(p => p._id === id);
    return paciente
      ? `${paciente.nombre?.split(' ')[0] || ''} ${paciente.apellido?.split(' ')[0] || ''}`
      : 'Paciente';
  };

  const formatFecha = (fechaStr) => {
    const fecha = new Date(fechaStr);
    const hoy = new Date();

    if (fecha.toDateString() === hoy.toDateString()) {
      return 'Hoy';
    }

    const opciones = { weekday: 'short', day: 'numeric' };
    return fecha.toLocaleDateString('es-ES', opciones);
  };

  return (
    <div className="bg-white rounded-xl shadow-sm p-5 border border-gray-100">
      <div className="flex justify-between items-center mb-4">
        <h3 className="text-lg font-semibold text-gray-800">üóìÔ∏è Citas Programadas de la Semana</h3>
        <span className="text-xs bg-blue-50 text-blue-600 px-2 py-1 rounded-full">
          {new Date().toLocaleDateString('es-ES', { day: 'numeric', month: 'short' })}
        </span>
      </div>

      {citasSemana.length === 0 ? (
        <div className="text-center py-6">
          <p className="text-gray-500">No hay citas pendientes para los pr√≥ximos 7 d√≠as.</p>
        </div>
      ) : (
        <div className="space-y-3">
          {citasSemana.map(cita => (
            <div key={cita._id} className="p-3 hover:bg-gray-50 rounded-lg transition-colors border border-gray-100">
              <div className="flex items-start">
                <div className="flex-shrink-0 mt-1">
                  <div className="h-10 w-10 rounded-full bg-blue-100 flex items-center justify-center">
                    <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 text-blue-600" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 7V3m8 4V3m-9 8h10M5 21h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v12a2 2 0 002 2z" />
                    </svg>
                  </div>
                </div>
                <div className="ml-3 flex-1 min-w-0">
                  <p className="text-sm font-medium text-gray-900 truncate">
                    {getPacienteNombre(cita.pacienteId)}
                  </p>
                  <p className="text-sm text-gray-500">{cita.motivo}</p>
                  <div className="mt-1 flex items-center justify-between">
                    <span className="text-xs font-medium text-gray-500">
                      {formatFecha(cita.fecha)} ‚Ä¢ {cita.hora}
                    </span>
                    <span className="text-xs px-2 py-0.5 rounded-full bg-yellow-100 text-yellow-800">
                      Pendiente
                    </span>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default WeeklyAppointments;
